import Modal from "react-bootstrap/Modal";
import Button from "react-bootstrap/Button";

const MyBoxes = ({
    myBoxes,
    handleMyBoxesClose,
    currentUser
    }) => {
        return(
            <Modal
                show={myBoxes}
                onHide={handleMyBoxesClose}
                backdrop="true"
                fade="true"
                centered="true"
            >
                <Modal.Header closeButton>
                    <Modal.Title><h3>My Boxes</h3></Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    {/* <h4>Boxes:</h4>
                    <div>
                        <h5>Location:</h5>
                        {Object.hasOwn(currentUser, "_id") && (
                            <ul className="allBoxes">
                                <MyBoxes currentUser={currentUser} />
                            </ul>
                        )}

                    </div> */}
                </Modal.Body>
                <Modal.Footer>
                    <Button variant="secondary" onClick={handleMyBoxesClose}>
                        Cancel
                    </Button>
                    <Button variant="primary" onClick={handleMyBoxesClose}>
                        Save settings
                    </Button>
                </Modal.Footer>
            </Modal>

        );
    };
        


export default MyBoxes;
